import React from "react";
import "./GameHead.css";

const GameHead = () => {
  return (
    <>
      <img
        src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTH-09vWtk9boYD5rRIHvdVdn773xuqEWfGzw&usqp=CAU"
        alt=""
        height="260px"
        width="100%"
        backgroundsize="cover"   
      />
      {/* <h3>Game Start Soon</h3> */}
    </>
  );
};
export default GameHead;
